   stbi_uc  size[257];","   unsigned int maxcode[18];","   int    delta[17];   // old 'firstsymbol' - old 'firstcode'","} stbi__huffman;","","typedef struct","{","   stbi__context *s;","   stbi__huffman huff_dc[4];","   stbi__huffman huff_ac[4];","   stbi__uint16 dequant[4][64];","   stbi__int16 fast_ac[4][1 \u003c\u003c FAST_BITS];","","// sizes for components, interleaved MCUs","   int img_h_max, img_v_max;","   int img_mcu_x, img_mcu_y;","   int img_mcu_w, img_mcu_h;","","// definition of jpeg image component","   struct","   {","      int id;","      int h,v;","      int tq;","      int hd,ha;","      int dc_pred;","","      int x,y,w2,h2;","      stbi_uc *data;","      void *raw_data, *raw_coeff;","      stbi_uc *linebuf;","      short   *coeff;   // progressive only","      int      coeff_w, coeff_h; // number of 8x8 coefficient blocks","   } img_comp[4];","","   stbi__uint32   code_buffer; // jpeg entropy-coded buffer","   int            code_bits;   // number of valid bits","   unsigned char  marker;      // marker seen while filling entropy buffer","   int            nomore;      // flag if we saw a marker so must stop","","   int            progressive;","   int            spec_start;","   int            spec_end;","   int            succ_high;","   int            succ_low;","   int            eob_run;","   int            jfif;","   int            app14_color_transform; // Adobe APP14 tag","   int            rgb;","","   int scan_n, order[4];","   int restart_interval, todo;","","// kernels","   void (*idct_block_kernel)(stbi_uc *out, int out_stride, short data[64]);","   void (*YCbCr_to_RGB_kernel)(stbi_uc *out, const stbi_uc *y, const stbi_uc *pcb, const stbi_uc *pcr, int count, int step);","   stbi_uc *(*resample_row_hv_2_kernel)(stbi_uc *out, stbi_uc *in_near, stbi_uc *in_far, int w, int hs);","} stbi__jpeg;","","static int stbi__build_huffman(stbi__huffman *h, int *count)","{","   int i,j,k=0;","   unsigned int code;","   // build size list for each symbol (from JPEG spec)","   for (i=0; i \u003c 16; ++i) {","      for (j=0; j \u003c count[i]; ++j) {","         h-\u003esize[k++] = (stbi_uc) (i+1);","         if(k \u003e= 257) return stbi__err(\"bad size list\",\"Corrupt JPEG\");","      }","   }","   h-\u003esize[k] = 0;","","   // compute actual symbols (from jpeg spec)","   code = 0;","   k = 0;","   for(j=1; j \u003c= 16; ++j) {","      // compute delta to add to code to compute symbol id","      h-\u003edelta[j] = k - code;","      if (h-\u003esize[k] == j) {","         while (h-\u003esize[k] == j)","            h-\u003ecode[k++] = (stbi__uint16) (code++);","         if (code-1 \u003e= (1u \u003c\u003c j)) return stbi__err(\"bad code lengths\",\"Corrupt JPEG\");","      }","      // compute largest code + 1 for this size, preshifted as needed later","      h-\u003emaxcode[j] = code \u003c\u003c (16-j);","      code \u003c\u003c= 1;","   }","   h-\u003emaxcode[j] = 0xffffffff;","","   // build non-spec acceleration table; 255 is flag for not-accelerated","   memset(h-\u003efast, 255, 1 \u003c\u003c FAST_BITS);","   for (i=0; i \u003c k; ++i) {","      int s = h-\u003esize[i];","      if (s \u003c= FAST_BITS) {","         int c = h-\u003ecode[i] \u003c\u003c (FAST_BITS-s);","         int m = 1 \u003c\u003c (FAST_BITS-s);","         for (j=0; j \u003c m; ++j) {","            h-\u003efast[c+j] = (stbi_uc) i;","         }","      }","   }","   return 1;","}","","// build a table that decodes both magnitude and value of small ACs in","// one go.","static void stbi__build_fast_ac(stbi__int16 *fast_ac, stbi__huffman *h)","{","   int i;","   for (i=0; i \u003c (1 \u003c\u003c FAST_BITS); ++i) {","      stbi_uc fast = h-\u003efast[i];","      fast_ac[i] = 0;","      if (fast \u003c 255) {","         int rs = h-\u003evalues[fast];","         int run = (rs \u003e\u003e 4) \u0026 15;","         int magbits = rs \u0026 15;","         int len = h-\u003esize[fast];","","         if (magbits \u0026\u0026 len + magbits \u003c= FAST_BITS) {","            // magnitude code followed by receive_extend code","            int k = ((i \u003c\u003c len) \u0026 ((1 \u003c\u003c FAST_BITS) - 1)) \u003e\u003e (FAST_BITS - magbits);","            int m = 1 \u003c\u003c (magbits - 1);","            if (k \u003c m) k += (~0U \u003c\u003c magbits) + 1;","            // if the result is small enough, we can fit it in fast_ac table","            if (k \u003e= -128 \u0026\u0026 k \u003c= 127)","               fast_ac[i] = (stbi__int16) ((k * 256) + (run * 16) + (len + magbits));","         }","      }","   }","}","","static void stbi__grow_buffer_unsafe(stbi__jpeg *j)","{","   do {","      unsigned int b = j-\u003enomore ? 0 : stbi__get8(j-\u003es);","      if (b == 0xff) {","         int c = stbi__get8(j-\u003es);","         while (c == 0xff) c = stbi__get8(j-\u003es); // consume fill bytes","         if (c != 0) {","            j-\u003emarker = (unsigned char) c;","            j-\u003enomore = 1;","            return;","         }","      }","      j-\u003ecode_buffer |= b \u003c\u003c (24 - j-\u003ecode_bits);","      j-\u003ecode_bits += 8;","   } while (j-\u003ecode_bits \u003c= 24);","}","","// (1 \u003c\u003c n) - 1","static const stbi__uint32 stbi__bmask[17]={0,1,3,7,15,31,63,127,255,511,1023,2047,4095,8191,16383,32767,65535};","","// decode a jpeg huffman value from the bitstream","stbi_inline static int stbi__jpeg_huff_decode(stbi__jpeg *j, stbi__huffman *h)","{","   unsigned int temp;","   int c,k;","","   if (j-\u003ecode_bits \u003c 16) stbi__grow_buffer_unsafe(j);","","   // look at the top FAST_BITS and determine what symbol ID it is,","   // if the code is \u003c= FAST_BITS","   c = (j-\u003ecode_buffer \u003e\u003e (32 - FAST_BITS)) \u0026 ((1 \u003c\u003c FAST_BITS)-1);","   k = h-\u003efast[c];","   if (k \u003c 255) {","      int s = h-\u003esize[k];","      if (s \u003e j-\u003ecode_bits)","         return -1;","      j-\u003ecode_buffer \u003c\u003c= s;","      j-\u003ecode_bits -= s;","      return h-\u003evalues[k];","   }","","   // naive test is to shift the code_buffer down so k bits are","   // valid, then test against maxcode. To speed this up, we've","   // preshifted maxcode left so that it has (16-k) 0s at the","   // end; in other words, regardless of the number of bits, it","   // wants to be compared against something shifted to have 16;","   // that way we don't need to shift inside the loop.","   temp = j-\u003ecode_buffer \u003e\u003e 16;","   for (k=FAST_BITS+1 ; ; ++k)","      if (temp \u003c h-\u003emaxcode[k])","         break;","   if (k == 17) {","      // error! code not found","      j-\u003ecode_bits -= 16;","      return -1;","   }","","   if (k \u003e j-\u003ecode_bits)","      return -1;","","   // convert the huffman code to the symbol id","   c = ((j-\u003ecode_buffer \u003e\u003e (32 - k)) \u0026 stbi__bmask[k]) + h-\u003edelta[k];","   if(c \u003c 0 || c \u003e= 256) // symbol id out of bounds!","       return -1;","   STBI_ASSERT((((j-\u003ecode_buffer) \u003e\u003e (32 - h-\u003esize[c])) \u0026 stbi__bmask[h-\u003esize[c]]) == h-\u003ecode[c]);","","   // convert the id to a symbol","   j-\u003ecode_bits -= k;","   j-\u003ecode_buffer \u003c\u003c= k;","   return h-\u003evalues[c];","}","","// bias[n] = (-1\u003c\u003cn) + 1","static const int stbi__jbias[16] = {0,-1,-3,-7,-15,-31,-63,-127,-255,-511,-1023,-2047,-4095,-8191,-16383,-32767};","","// combined JPEG 'receive' and JPEG 'extend', since baseline","// always extends everything it receives.","stbi_inline static int stbi__extend_receive(stbi__jpeg *j, int n)","{","   unsigned int k;","   int sgn;","   if (j-\u003ecode_bits \u003c n) stbi__grow_buffer_unsafe(j);","   if (j-\u003ecode_bits \u003c n) return 0; // ran out of bits from stream, return 0s intead of continuing","","   sgn = j-\u003ecode_buffer \u003e\u003e 31; // sign bit always in MSB; 0 if MSB clear (positive), 1 if MSB set (negative)","   k = stbi_lrot(j-\u003ecode_buffer, n);","   j-\u003ecode_buffer = k \u0026 ~stbi__bmask[n];","   k \u0026= stbi__bmask[n];","   j-\u003ecode_bits -= n;","   return k + (stbi__jbias[n] \u0026 (sgn - 1));","}","","// get some unsigned bits","stbi_inline static int stbi__jpeg_get_bits(stbi__jpeg *j, int n)","{","   unsigned int k;","   if (j-\u003ecode_bits \u003c n) stbi__grow_buffer_unsafe(j);","   if (j-\u003ecode_bits \u003c n) return 0; // ran out of bits from stream, return 0s intead of continuing","   k = stbi_lrot(j-\u003ecode_buffer, n);","   j-\u003ecode_buffer = k \u0026 ~stbi__bmask[n];","   k \u0026= stbi__bmask[n];","   j-\u003ecode_bits -= n;","   return k;","}","","stbi_inline static int stbi__jpeg_get_bit(stbi__jpeg *j)","{","   unsigned int k;","   if (j-\u003ecode_bits \u003c 1) stbi__grow_buffer_unsafe(j);","   if (j-\u003ecode_bits \u003c 1) return 0; // ran out of bits from stream, return 0s intead of continuing","   k = j-\u003ecode_buffer;","   j-\u003ecode_buffer \u003c\u003c= 1;","   --j-\u003ecode_bits;","   return k \u0026 0x80000000;","}","","// given a value that's at position X in the zigzag stream,","// where does it appear in the 8x8 matrix coded as row-major?","static const stbi_uc stbi__jpeg_dezigzag[64+15] =","{","    0,  1,  8, 16,  9,  2,  3, 10,","   17, 24, 32, 25, 18, 11,  4,  5,","   12, 19, 26, 33, 40, 48, 41, 34,","   27, 20, 13,  6,  7, 14, 21, 28,","   35, 42, 49, 56, 57, 50, 43, 36,","   29, 22, 15, 23, 30, 37, 44, 51,","   58, 59, 52, 45, 38, 31, 39, 46,","   53, 60, 61, 54, 47, 55, 62, 63,","   // let corrupt input sample past end","   63, 63, 63, 63, 63, 63, 63, 63,","   63, 63, 63, 63, 63, 63, 63","};","","// decode one 64-entry block--","static int stbi__jpeg_decode_block(stbi__jpeg *j, short data[64], stbi__huffman *hdc, stbi__huffman *hac, stbi__int16 *fac, int b, stbi__uint16 *dequant)","{","   int diff,dc,k;","   int t;","","   if (j-\u003ecode_bits \u003c 16) stbi__grow_buffer_unsafe(j);","   t = stbi__jpeg_huff_decode(j, hdc);","   if (t \u003c 0 || t \u003e 15) return stbi__err(\"bad huffman code\",\"Corrupt JPEG\");","","   // 0 all the ac values now so we can do it 32-bits at a time","   memset(data,0,64*sizeof(data[0]));","","   diff = t ? stbi__extend_receive(j, t) : 0;","   if (!stbi__addints_valid(j-\u003eimg_comp[b].dc_pred, diff)) return stbi__err(\"bad delta\",\"Corrupt JPEG\");","   dc = j-\u003eimg_comp[b].dc_pred + diff;","   j-\u003eimg_comp[b].dc_pred = dc;","   if (!stbi__mul2shorts_valid(dc, dequant[0])) return stbi__err(\"can't merge dc and ac\", \"Corrupt JPEG\");","   data[0] = (short) (dc * dequant[0]);","","   // decode AC components, see JPEG spec","   k = 1;","   do {","      unsigned int zig;","      int c,r,s;","      if (j-\u003ecode_bits \u003c 16) stbi__grow_buffer_unsafe(j);","      c = (j-\u003ecode_buffer \u003e\u003e (32 - FAST_BITS)) \u0026 ((1 \u003c\u003c FAST_BITS)-1);","      r = fac[c];","      if (r) { // fast-AC path","         k += (r \u003e\u003e 4) \u0026 15; // run","         s = r \u0026 15; // combined length","         if (s \u003e j-\u003ecode_bits) return stbi__err(\"bad huffman code\", \"Combined length longer than code bits available\");","         j-\u003ecode_buffer \u003c\u003c= s;","         j-\u003ecode_bits -= s;","         // decode into unzigzag'd location","         zig = stbi__jpeg_dezigzag[k++];","         data[zig] = (short) ((r \u003e\u003e 8) * dequant[zig]);","      } else {","         int rs = stbi__jpeg_huff_decode(j, hac);","         if (rs \u003c 0) return stbi__err(\"bad huffman code\",\"Corrupt JPEG\");","         s = rs \u0026 15;","         r = rs \u003e\u003e 4;","         if (s == 0) {","            if (rs != 0xf0) break; // end block","            k += 16;","         } else {","            k += r;","            // decode into unzigzag'd location","            zig = stbi__jpeg_dezigzag[k++];","            data[zig] = (short) (stbi__extend_receive(j,s) * dequant[zig]);","         }","      }","   } while (k \u003c 64);","   return 1;","}","","static int stbi__jpeg_decode_block_prog_dc(stbi__jpeg *j, short data[64], stbi__huffman *hdc, int b)","{","   int diff,dc;","   int t;","   if (j-\u003espec_end != 0) return stbi__err(\"can't merge dc and ac\", \"Corrupt JPEG\");","","   if (j-\u003ecode_bits \u003c 16) stbi__grow_buffer_unsafe(j);","","   if (j-\u003esucc_high == 0) {","      // first scan for DC coefficient, must be first","      memset(data,0,64*sizeof(data[0])); // 0 all the ac values now","      t = stbi__jpeg_huff_decode(j, hdc);","      if (t \u003c 0 || t \u003e 15) return stbi__err(\"can't merge dc and ac\", \"Corrupt JPEG\");","      diff = t ? stbi__extend_receive(j, t) : 0;","","      if (!stbi__addints_valid(j-\u003eimg_comp[b].dc_pred, diff)) return stbi__err(\"bad delta\", \"Corrupt JPEG\");","      dc = j-\u003eimg_comp[b].dc_pred + diff;","      j-\u003eimg_comp[b].dc_pred = dc;","      if (!stbi__mul2shorts_valid(dc, 1 \u003c\u003c j-\u003esucc_low)) return stbi__err(\"can't merge dc and ac\", \"Corrupt JPEG\");","      data[0] = (short) (dc * (1 \u003c\u003c j-\u003esucc_low));","   } else {","      // refinement scan for DC coefficient","      if (stbi__jpeg_get_bit(j))","         data[0] += (short) (1 \u003c\u003c j-\u003esucc_low);","   }","   return 1;","}","","// @OPTIMIZE: store non-zigzagged during the decode passes,","// and only de-zigzag when dequantizing","static int stbi__jpeg_decode_block_prog_ac(stbi__jpeg *j, short data[64], stbi__huffman *hac, stbi__int16 *fac)","{","   int k;","   if (j-\u003espec_start == 0) return stbi__err(\"can't merge dc and ac\", \"Corrupt JPEG\");","","   if (j-\u003esucc_high == 0) {","      int shift = j-\u003esucc_low;","","      if (j-\u003eeob_run) {","         --j-\u003eeob_run;","         return 1;","      }","","      k = j-\u003espec_start;","      do {","         unsigned int zig;","         int c,r,s;","         if (j-\u003ecode_bits \u003c 16) stbi__grow_buffer_unsafe(j);","         c = (j-\u003ecode_buffer \u003e\u003e (32 - FAST_BITS)) \u0026 ((1 \u003c\u003c FAST_BITS)-1);","         r = fac[c];","         if (r) { // fast-AC path","            k += (r \u003e\u003e 4) \u0026 15; // run","            s = r \u0026 15; // combined length","            if (s \u003e j-\u003ecode_bits) return stbi__err(\"bad huffman code\", \"Combined length longer than code bits available\");","            j-\u003ecode_buffer \u003c\u003c= s;","            j-\u003ecode_bits -= s;","            zig = stbi__jpeg_dezigzag[k++];","            data[zig] = (short) ((r \u003e\u003e 8) * (1 \u003c\u003c shift));","         } else {","            int rs = stbi__jpeg_huff_decode(j, hac);","            if (rs \u003c 0) return stbi__err(\"bad huffman code\",\"Corrupt JPEG\");","            s = rs \u0026 15;","            r = rs \u003e\u003e 4;","            if (s == 0) {","               if (r \u003c 15) {","                  j-\u003eeob_run = (1 \u003c\u003c r);","                  if (r)","                     j-\u003eeob_run += stbi__jpeg_get_bits(j, r);","                  --j-\u003eeob_run;","                  break;","               }","               k += 16;","            } else {","               k += r;","               zig = stbi__jpeg_dezigzag[k++];","               data[zig] = (short) (stbi__extend_receive(j,s) * (1 \u003c\u003c shift));","            }","         }","      } while (k \u003c= j-\u003espec_end);","   } else {","      // refinement scan for these AC coefficients","","      short bit = (short) (1 \u003c\u003c j-\u003esucc_low);","","      if (j-\u003eeob_run) {","         --j-\u003eeob_run;","         for (k = j-\u003espec_start; k \u003c= j-\u003espec_end; ++k) {","            short *p = \u0026data[stbi__jpeg_dezigzag[k]];","            if (*p != 0)","               if (stbi__jpeg_get_bit(j))","                  if ((*p \u0026 bit)==0) {","                     if (*p \u003e 0)","                        *p += bit;","                     else","                        *p -= bit;","                  }","         }","      } else {","         k = j-\u003espec_start;","         do {","            int r,s;","            int rs = stbi__jpeg_huff_decode(j, hac); // @OPTIMIZE see if we can use the fast path here, advance-by-r is so slow, eh","            if (rs \u003c 0) return stbi__err(\"bad huffman code\",\"Corrupt JPEG\");","            s = rs \u0026 15;","            r = rs \u003e\u003e 4;","            if (s == 0) {","               if (r \u003c 15) {","                  j-\u003eeob_run = (1 \u003c\u003c r) - 1;","                  if (r)","                     j-\u003eeob_run += stbi__jpeg_get_bits(j, r);","                  r = 64; // force end of block","               } else {","                  // r=15 s=0 should write 16 0s, so we just do","                  // a run of 15 0s and then write s (which is 0),","                  // so we don't have to do anything special here","               }","            } else {","               if (s != 1) return stbi__err(\"bad huffman code\", \"Corrupt JPEG\");","               // sign bit","               if (stbi__jpeg_get_bit(j))","                  s = bit;","               else","                  s = -bit;","            }","","            // advance by r","            while (k \u003c= j-\u003espec_end) {","               short *p = \u0026data[stbi__jpeg_dezigzag[k++]];","               if (*p != 0) {","                  if (stbi__jpeg_get_bit(j))","                     if ((*p \u0026 bit)==0) {","                        if (*p \u003e 0)","                           *p += bit;","                        else","                           *p -= bit;","                     }","               } else {","                  if (r == 0) {","                     *p = (short) s;","                     break;","                  }","                  --r;","               }","            }","         } while (k \u003c= j-\u003espec_end);","      }","   }","   return 1;","}","","// take a -128..127 value and stbi__clamp it and convert to 0..255","stbi_inline static stbi_uc stbi__clamp(int x)","{","   // trick to use a single test to catch both cases","   if ((unsigned int) x \u003e 255) {","      if (x \u003c 0) return 0;","      if (x \u003e 255) return 255;","   }","   return (stbi_uc) x;","}","","#define stbi__f2f(x)  ((int) (((x) * 4096 + 0.5)))","#define stbi__fsh(x)  ((x) * 4096)","","// derived from jidctint -- DCT_ISLOW","#define STBI__IDCT_1D(s0,s1,s2,s3,s4,s5,s6,s7) \\","   int t0,t1,t2,t3,p1,p2,p3,p4,p5,x0,x1,x2,x3; \\","   p2 = s2;                                    \\","   p3 = s6;                                    \\","   p1 = (p2+p3) * stbi__f2f(0.5411961f);       \\","   t2 = p1 + p3*stbi__f2f(-1.847759065f);      \\","   t3 = p1 + p2*stbi__f2f( 0.765366865f);      \\","   p2 = s0;                                    \\","   p3 = s4;                                    \\","   t0 = stbi__fsh(p2+p3);                      \\","   t1 = stbi__fsh(p2-p3);                      \\","   x0 = t0+t3;                                 \\","   x3 = t0-t3;                                 \\","   x1 = t1+t2;                                 \\","   x2 = t1-t2;                                 \\","   t0 = s7;                                    \\","   t1 = s5;                                    \\","   t2 = s3;                                    \\","   t3 = s1;                                    \\","   p3 = t0+t2;                                 \\","   p4 = t1+t3;                                 \\","   p1 = t0+t3;                                 \\","   p2 = t1+t2;                                 \\","   p5 = (p3+p4)*stbi__f2f( 1.175875602f);      \\","   t0 = t0*stbi__f2f( 0.298631336f);           \\","   t1 = t1*stbi__f2f( 2.053119869f);           \\","   t2 = t2*stbi__f2f( 3.072711026f);           \\","   t3 = t3*stbi__f2f( 1.501321110f);           \\","   p1 = p5 + p1*stbi__f2f(-0.899976223f);      \\","   p2 = p5 + p2*stbi__f2f(-2.562915447f);      \\","   p3 = p3*stbi__f2f(-1.961570560f);           \\","   p4 = p4*stbi__f2f(-0.390180644f);           \\","   t3 += p1+p4;                                \\","   t2 += p2+p3;                                \\","   t1 += p2+p4;                                \\","   t0 += p1+p3;","","static void stbi__idct_block(stbi_uc *out, int out_stride, short data[64])","{","   int i,val[64],*v=val;","   stbi_uc *o;","   short *d = data;","","   // columns","   for (i=0; i \u003c 8; ++i,++d, ++v) {","      // if all zeroes, shortcut -- this avoids dequantizing 0s and IDCTing","      if (d[ 8]==0 \u0026\u0026 d[16]==0 \u0026\u0026 d[24]==0 \u0026\u0026 d[32]==0","           \u0026\u0026 d[40]==0 \u0026\u0026 d[48]==0 \u0026\u0026 d[56]==0) {","         //    no shortcut                 0     seconds","         //    (1|2|3|4|5|6|7)==0          0     seconds","         //    all separate               -0.047 seconds","         //    1 \u0026\u0026 2|3 \u0026\u0026 4|5 \u0026\u0026 6|7:    -0.047 seconds","         int dcterm = d[0]*4;","         v[0] = v[8] = v[16] = v[24] = v[32] = v[40] = v[48] = v[56] = dcterm;","      } else {","         STBI__IDCT_1D(d[ 0],d[ 8],d[16],d[24],d[32],d[40],d[48],d[56])","         // constants scaled things up by 1\u003c\u003c12; let's bring them back","         // down, but keep 2 extra bits of precision","         x0 += 512; x1 += 512; x2 += 512; x3 += 512;","         v[ 0] = (x0+t3) \u003e\u003e 10;","         v[56] = (x0-t3) \u003e\u003e 10;","         v[ 8] = (x1+t2) \u003e\u003e 10;","         v[48] = (x1-t2) \u003e\u003e 10;","         v[16] = (x2+t1) \u003e\u003e 10;","         v[40] = (x2-t1) \u003e\u003e 10;","         v[24] = (x3+t0) \u003e\u003e 10;","         v[32] = (x3-t0) \u003e\u003e 10;","      }","   }","","   for (i=0, v=val, o=out; i \u003c 8; ++i,v+=8,o+=out_stride) {","      // no fast case since the first 1D IDCT spread components out","      STBI__IDCT_1D(v[0],v[1],v[2],v[3],v[4],v[5],v[6],v[7])","      // constants scaled things up by 1\u003c\u003c12, plus we had 1\u003c\u003c2 from first","      // loop, plus horizontal and vertical each scale by sqrt(8) so together","      // we've got an extra 1\u003c\u003c3, so 1\u003c\u003c17 total we need to remove.","      // so we want to round that, which means adding 0.5 * 1\u003c\u003c17,","      // aka 65536. Also, we'll end up with -128 to 127 that we want","      // to encode as 0..255 by adding 128, so we'll add that before the shift","      x0 += 65536 + (128\u003c\u003c17);","      x1 += 65536 + (128\u003c\u003c17);","      x2 += 65536 + (128\u003c\u003c17);","      x3 += 65536 + (128\u003c\u003c17);","      // tried computing the shifts into temps, or'ing the temps to see","      // if any were out of range, but that was slower","      o[0] = stbi__clamp((x0+t3) \u003e\u003e 17);","      o[7] = stbi__clamp((x0-t3) \u003e\u003e 17);","      o[1] = stbi__clamp((x1+t2) \u003e\u003e 17);","      o[6] = stbi__clamp((x1-t2) \u003e\u003e 17);","      o[2] = stbi__clamp((x2+t1) \u003e\u003e 17);","      o[5] = stbi__clamp((x2-t1) \u003e\u003e 17);","      o[3] = stbi__clamp((x3+t0) \u003e\u003e 17);","      o[4] = stbi__clamp((x3-t0) \u003e\u003e 17);","   }","}","","#ifdef STBI_SSE2","// sse2 integer IDCT. not the fastest possible implementation but it","// produces bit-identical results to the generic C version so it's","// fully \"transparent\".","static void stbi__idct_simd(stbi_uc *out, int out_stride, short data[64])","{","   // This is constructed to match our regular (generic) integer IDCT exactly.","   __m128i row0, row1, row2, row3, row4, row5, row6, row7;","   __m128i tmp;","","   // dot product constant: even elems=x, odd elems=y","   #define dct_const(x,y)  _mm_setr_epi16((x),(y),(x),(y),(x),(y),(x),(y))","","   // out(0) = c0[even]*x + c0[odd]*y   (c0, x, y 16-bit, out 32-bit)","   // out(1) = c1[even]*x + c1[odd]*y","   #define dct_rot(out0,out1, x,y,c0,c1) \\","      __m128i c0##lo = _mm_unpacklo_epi16((x),(y)); \\","      __m128i c0##hi = _mm_unpackhi_epi16((x),(y)); \\","      __m128i out0##_l = _mm_madd_epi16(c0##lo, c0); \\","      __m128i out0##_h = _mm_madd_epi16(c0##hi, c0); \\","      __m128i out1##_l = _mm_madd_epi16(c0##lo, c1); \\","      __m128i out1##_h = _mm_madd_epi16(c0##hi, c1)","","   // out = in \u003c\u003c 12  (in 16-bit, out 32-bit)","   #define dct_widen(out, in) \\","      __m128i out##_l = _mm_srai_epi32(_mm_unpacklo_epi16(_mm_setzero_si128(), (in)), 4); \\","      __m128i out##_h = _mm_srai_epi32(_mm_unpackhi_epi16(_mm_setzero_si128(), (in)), 4)","","   // wide add","   #define dct_wadd(out, a, b) \\","      __m128i out##_l = _mm_add_epi32(a##_l, b##_l); \\","      __m128i out##_h = _mm_add_epi32(a##_h, b##_h)","","   // wide sub","   #define dct_wsub(out, a, b) \\","      __m128i out##_l = _mm_sub_epi32(a##_l, b##_l); \\","      __m128i out##_h = _mm_sub_epi32(a##_h, b##_h)","","   // butterfly a/b, add bias, then shift by \"s\" and pack","   #define dct_bfly32o(out0, out1, a,b,bias,s) \\","      { \\","         __m128i abiased_l = _mm_add_epi32(a##_l, bias); \\","         __m128i abiased_h = _mm_add_epi32(a##_h, bias); \\","         dct_wadd(sum, abiased, b); \\","         dct_wsub(dif, abiased, b); \\","         out0 = _mm_packs_epi32(_mm_srai_epi32(sum_l, s), _mm_srai_epi32(sum_h, s)); \\","         out1 = _mm_packs_epi32(_mm_srai_epi32(dif_l, s), _mm_srai_epi32(dif_h, s)); \\","      }","","   // 8-bit interleave step (for transposes)","   #define dct_interleave8(a, b) \\","      tmp = a; \\","      a = _mm_unpacklo_epi8(a, b); \\","      b = _mm_unpackhi_epi8(tmp, b)","","   // 16-bit interleave step (for transposes)","   #define dct_interleave16(a, b) \\","      tmp = a; \\","      a = _mm_unpacklo_epi16(a, b); \\","      b = _mm_unpackhi_epi16(tmp, b)","","   #define dct_pass(bias,shift) \\","      { \\","         /* even part */ \\","         dct_rot(t2e,t3e, row2,row6, rot0_0,rot0_1); \\","         __m128i sum04 = _mm_add_epi16(row0, row4); \\","         __m128i dif04 = _mm_sub_epi16(row0, row4); \\","         dct_widen(t0e, sum04); \\","         dct_widen(t1e, dif04); \\","         dct_wadd(x0, t0e, t3e); \\","         dct_wsub(x3, t0e, t3e); \\","         dct_wadd(x1, t1e, t2e); \\","         dct_wsub(x2, t1e, t2e); \\","         /* odd part */ \\","         dct_rot(y0o,y2o, row7,row3, rot2_0,rot2_1); \\","         dct_rot(y1o,y3o, row5,row1, rot3_0,rot3_1); \\","         __m128i sum17 = _mm_add_epi16(row1, row7); \\","         __m128i sum35 = _mm_add_epi16(row3, row5); \\","         dct_rot(y4o,y5o, sum17,sum35, rot1_0,rot1_1); \\","         dct_wadd(x4, y0o, y4o); \\","         dct_wadd(x5, y1o, y5o); \\","         dct_wadd(x6, y2o, y5o); \\","         dct_wadd(x7, y3o, y4o); \\","         dct_bfly32o(row0,row7, x0,x7,bias,shift); \\","         dct_bfly32o(row1,row6, x1,x6,bias,shift); \\","         dct_bfly32o(row2,row5, x2,x5,bias,shift); \\","         dct_bfly32o(row3,row4, x3,x4,bias,shift); \\","      }","","   __m128i rot0_0 = dct_const(stbi__f2f(0.5411961f), stbi__f2f(0.5411961f) + stbi__f2f(-1.847759065f));","   __m128i rot0_1 = dct_const(stbi__f2f(0.5411961f) + stbi__f2f( 0.765366865f), stbi__f2f(0.5411961f));","   __m128i rot1_0 = dct_const(stbi__f2f(1.175875602f) + stbi__f2f(-0.899976223f), stbi__f2f(1.175875602f));","   __m128i rot1_1 = dct_const(stbi__f2f(1.175875602f), stbi__f2f(1.175875602f) + stbi__f2f(-2.562915447f));","   __m128i rot2_0 = dct_const(stbi__f2f(-1.961570560f) + stbi__f2f( 0.298631336f), stbi__f2f(-1.961570560f));","   __m128i rot2_1 = dct_const(stbi__f2f(-1.961570560f), stbi__f2f(-1.961570560f) + stbi__f2f( 3.072711026f));","   __m128i rot3_0 = dct_const(stbi__f2f(-0.390180644f) + stbi__f2f( 2.053119869f), stbi__f2f(-0.390180644f));","   __m128i rot3_1 = dct_const(stbi__f2f(-0.390180644f), stbi__f2f(-0.390180644f) + stbi__f2f( 1.501321110f));","","   // rounding biases in column/row passes, see stbi__idct_block for explanation.","   __m128i bias_0 = _mm_set1_epi32(512);","   __m128i bias_1 = _mm_set1_epi32(65536 + (128\u003c\u003c17));","","   // load","   row0 = _mm_load_si128((const __m128i *) (data + 0*8));","   row1 = _mm_load_si128((const __m128i *) (data + 1*8));","   row2 = _mm_load_si128((const __m128i *) (data + 2*8));","   row3 = _mm_load_si128((const __m128i *) (data + 3*8));","   row4 = _mm_load_si128((const __m128i *) (data + 4*8));","   row5 = _mm_load_si128((const __m128i *) (data + 5*8));","   row6 = _mm_load_si128((const __m128i *) (data + 6*8));","   row7 = _mm_load_si128((const __m128i *) (data + 7*8));","","   // column pass","   dct_pass(bias_0, 10);","","   {","      // 16bit 8x8 transpose pass 1","      dct_interleave16(row0, row4);","      dct_interleave16(row1, row5);","      dct_interleave16(row2, row6);","      dct_interleave16(row3, row7);","","      // transpose pass 2","      dct_interleave16(row0, row2);","      dct_interleave16(row1, row3);","      dct_interleave16(row4, row6);","      dct_interleave16(row5, row7);","","      // transpose pass 3","      dct_interleave16(row0, row1);","      dct_interleave16(row2, row3);","      dct_interleave16(row4, row5);","      dct_interleave16(row6, row7);","   }","","   // row pass","   dct_pass(bias_1, 17);","","   {","      // pack","      __m128i p0 = _mm_packus_epi16(row0, row1); // a0a1a2a3...a7b0b1b2b3...b7","      __m128i p1 = _mm_packus_epi16(row2, row3);","      __m128i p2 = _mm_packus_epi16(row4, row5);","      __m128i p3 = _mm_packus_epi16(row6, row7);","","      // 8bit 8x8 transpose pass 1","      dct_interleave8(p0, p2); // a0e0a1e1...","      dct_interleave8(p1, p3); // c0g0c1g1...","","      // transpose pass 2","      dct_interleave8(p0, p1); // a0c0e0g0...","      dct_interleave8(p2, p3); // b0d0f0h0...","","      // transpose pass 3","      dct_interleave8(p0, p2); // a0b0c0d0...","      dct_interleave8(p1, p3); // a4b4c4d4...","","      // store","      _mm_storel_epi64((__m128i *) out, p0); out += out_stride;","      _mm_storel_epi64((__m128i *) out, _mm_shuffle_epi32(p0, 0x